// import dependencies

// import components
// utils
import { Input1 } from "../../utils/inputs";
import { Navlink2 } from "../../utils/links";
import PrivateRoute from "../../utils/PrivateRoute";

const CreateBlog = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
  };

  const content = (
    <>
      <form className="form" onSubmit={handleSubmit}>
        <Input1 label="title" />
      </form>
      <Navlink2 text="return to dashboard" />
    </>
  );

  return <PrivateRoute content={content} title="New Blog" />;
};

export default CreateBlog;
